import React from 'react';
import './App.css';


function App() {
  return (
    <div id='User'>
     <div id='header'>
      <label id='name'>{props.name}</label>
      <label id='prof'>{props.occupation}</label>
     </div>
     <div id='email'>
      <label>undertaker@gmail.com</label>
     </div>
     <div id='body'>
     <label>Bio...</label>
     <div id='bio_div'>
     <p id='page'>I am a professional wrestler and I have an unbeaten streak at wrestlemania</p>
     </div>
     </div>
    </div>
  );
}

export default App;
